import Formulario from '../Formulário/Formulario';
import login from '../Imagens/Gifs/Figura login.gif'

function Login(){

    return(
        <div className='Login'>
            <img Login/>
            <div id='base-login'>
            <h1>Login</h1>
            <input type="email" id="nome" placeholder="Digite o seu email" name='nome'/>
            <input type="password" id="senha" placeholder="Digite a sua senha" name='senha'/>
            <button >Confirmar</button>
            </div>
        </div>
    );

}

export default Login;
